import React from "react";
import Container from 'react-bootstrap/Container';
import Header from "./Header";
import Content from "./Content";
import Footer from "./Footer";


function App() {
  

  return (
    <Container fluid >
      <Header />
      <Content />
      <Footer />
    </Container>
  );
}

export default App;
